	private static String makeFile(String base, String suffix, String text)
			throws IOException {
		String filename = null;
		PrintStream out = null;

		try {
			File file = File.createTempFile(base, suffix);
			file.deleteOnExit();

			filename = file.getCanonicalFile().toString();

			out = new PrintStream(new FileOutputStream(file));
			out.print(text);
			return filename;
		} finally {
			if (out != null) {
				out.flush();
				out.close();
			}
		}
	}

	public static class PrintlnFunction extends BaseFunction {
		@Override
		public void execute(TridentTuple tuple, TridentCollector collector) {
			System.out.println("New Tuple for printing: " + tuple.toString());
		}
	}

