	public static TridentTopology makeTopology() throws IOException {
		String pmml_file = makeFile("rf_test", ".xml", pmml_text);
		TridentTopology topology = new TridentTopology();

		String[] lines = data_text.split("\\n");
		List values = new ArrayList<Values>();
		for (int i = 1; i < lines.length; i++) {
			String[] lineDetails = lines[i].split("\\t");
			Values vals = new Values();
			for (int j = 0; j < lineDetails.length-2; j++) {
				vals.add(Double.parseDouble(lineDetails[j]));
			}
			values.add(vals);
		}
		List fields = Arrays.asList(lines[0].split("\\t"));
		FixedBatchSpout spout = new FixedBatchSpout(new Fields(fields), 1,
				(List<Object>[]) values.toArray(new Values[0]));
		spout.setCycle(true);

		topology.newStream("valueStream", spout)
				.each(new Fields(fields), new ClassifierFunction(pmml_file),
						new Fields("prediction"))
				.each(new Fields("prediction"), new PrintlnFunction(),
						new Fields());

		return topology;
	}

	public static void main(String[] args) throws Exception {
		Config conf = new Config();
		conf.setDebug(true);

		if (args != null && args.length > 0) {
			conf.setNumWorkers(3);

			StormSubmitter
					.submitTopology(args[0], conf, makeTopology().build());
		} else {
			conf.setMaxTaskParallelism(3);

			LocalCluster cluster = new LocalCluster();
			cluster.submitTopology("demo-patterns", conf, makeTopology()
					.build());

			Thread.sleep(10000);

			cluster.shutdown();
		}
	}
